import React, {Component} from 'react';
import './menu.css';

const Breakfast = () => {
    return (
        <React.Fragment>

       <table class="table table-bordered">

        <thead>
            <tr>
            <th scope="col">Producto</th>
            <th scope="col">Precio</th>
            <th scope="col">Cantidad</th>
            </tr>
        </thead>

          <tbody>
            <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            </tr>
            <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            </tr>
            <tr>
            <th scope="row">3</th>
            <td>Larry the Bird</td>
            <td>@twitter</td>
            </tr>
          </tbody>

        </table> 

        </React.Fragment>
    );
}

class ComponentButtons extends Component{
    render(){
        return (

        <React.Fragment>
                <div className="rectangle">
                <button type="button" onClick={Breakfast} className="btn btn-outline-info">Desayunos</button>      
                </div>

                <div className="rectangle2">
                <button type="button" onClick={Breakfast} className="btn btn-outline-info2">Almuerzos</button>
                </div>      

        </React.Fragment>
        );
    }
}    


export default ComponentButtons;
